:::{"id":"f1164ee1-fc7c-46c5-8635-c4bea338055a","title":{"en":"Safari Game"},"altTitles":[{"uk":"Гра в Сафарі"}],"availableTranslatedLanguages":["uk"],"description":{"en":"While looking at the famous Serengeti "The Three Colors" sunset at a bar, Ian a former military soldier met Lucy, a man who looked so familiar. Ian was swept away by his charm, invited Lucy into his room, 'I feel comfortable with Lucy's beautiful smile and gentle touch, but can I do it with a man that I just met three hours ago?But, what is he doing..."Are you going to put it in me?" +","uk":"Споглядаючи прекрасний захід сонця в барі «Три кольори» в Серенгеті, Єн, колишній військовий, зустрів Люсі - чоловіка, який здався йому дуже знайомим. Цей молодик неначе зачарував Єна, тож він запросив Люсі до себе.

 «Прекрасна посмішка та ніжні дотики Люсі зводять мене з розуму, але чи можу я займатись чимось таким із чоловіком, якого знаю лише 3 години? Мати Василева, що він робить?».
"Ти збираєшся вставити в мене ЦЕ?""},"originalLanguage":"ko","contentRating":"pornographic","tags":[{"id":"3de8c75d-8ee3-48ff-98ee-e20a65c86451","name":{"en":"Animals"}},{"id":"3e2b8dae-350e-4ab8-a8ce-016e844b9f0d","name":{"en":"Long Strip"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"e197df38-d0e7-43b5-9b09-2842d0c326dd","name":{"en":"Web Comic"}},{"id":"f5ba408b-0e7a-484d-8d49-4e9125ac96de","name":{"en":"Full Color"}}]}

