"I spent a night with a stranger at a hotel, having mistaken him for my boyfriend under the influence of alcohol. I tried to forget about that day and start over with my boyfriend … but after some time, I broke up with my boyfriend and became the mother of beautiful twins. After many challenges, I was chosen to be the secretary of a chairman at a large company! However, Chairman Lee is quite familiar?!"  

