:::{"id":"f1b94f72-09ea-45b0-ab8e-47d561822146","title":{"en":"Ryuujin-sama ga Hanashite Kurenai"},"altTitles":[{"ja":"龍神様が離してくれない"},{"en":"The Dragon God Won't Let Me Go"}],"lastChapter":"6.5","availableTranslatedLanguages":["en"],"description":{"en":"A story of the Animal-Human marriage between a CEO who’s in truth a lonely Dragon God, and a warm-hearted man with supernatural powers.

Scaredy cat Tamotsu, has been seeing ghosts since he was a child. This makes it very difficult for him to find a job and keep it. The only company that will hire him is a real estate agency that offers a cosy dormitory to its employees. Tamotsu starts working there with great motivation, but soon realises that all the employees of the company are “not human” and are all Spirits or Gods who have lost their habitats! With The Dragon God as the CEO of the company, a two tailed cat and a bird spirit as coworkers, Tamotsu begins working as a sales person.

The CEO notices Tamotsu is afraid of ghosts and offers him protection in exchange for a contract and he agrees to this kind offer from his reliable boss…Without knowing that this contract consist of having sex with the CEO!!!"},"links":{"amz":"https://www.amazon.co.jp/龍神様が離してくれない-バーズコミックス-リンクスコレクション-倉橋-蝶子/dp/4344846672","cdj":"https://www.cdjapan.co.jp/product/NEOBK-2493256","ebj":"https://ebookjapan.yahoo.co.jp/books/594084/A002397127/","mu":"194841","raw":"https://www.cmoa.jp/title/202456/"},"originalLanguage":"ja","contentRating":"erotica","tags":[{"id":"3bb26d85-09d5-4d2e-880c-c34b974339e9","name":{"en":"Ghosts"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"92d6d951-ca5e-429c-ac78-451071cbf064","name":{"en":"Office Workers"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}}]}

