Season Two: After imprinting with Minwoo, Yujin, who wishes to only be with Minwoo, ran into the biggest obstacle. “I don’t want this anymore.” It came as a sudden that Minwoo started to distance himself and reject Yujin. In the meantime, there seems to be a new sparkling romance for Minwoo…?
(Merman ALERT!!!!)"},"links":{"engtl":"https://www.pocketcomics.com/comic/7664?languageCode=en","mu":"180113","raw":"https://www.mrblue.com/webtoon/wt_000049911"},"originalLanguage":"ko","contentRating":"erotica","tags":[{"id":"3e2b8dae-350e-4ab8-a8ce-016e844b9f0d","name":{"en":"Long Strip"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"e197df38-d0e7-43b5-9b09-2842d0c326dd","name":{"en":"Web Comic"}},{"id":"f5ba408b-0e7a-484d-8d49-4e9125ac96de","name":{"en":"Full Color"}}]}

:::{"id":"f1ed4d7c-f699-4f9b-8b38-73c17e5e4f59","title":{"en":"Renaissance Eve"},"altTitles":[{"en":"ルネサンス・イヴ"}],"description":{"en":"A, B, AB, O…  

These are the common blood types with which most people are familiar, but there are rarer strains in the world, "hidden blood types." Individuals possessing these are called "strangebloods," and they are imbues with incredible abilities by the very blood flowing through their veins.  

But what happens when all of these disparate blood types come together? The result is rumored to be the legendary "Blood of Wisdom" which bestows god-like power. Little surprise, then, that more than a few unsavory characters are actively pursuing this awesome power. Can Chiaki Kaminaga and his friend Kaguya Daidouji survive this blood hunt…?"},"links":{"al":"81329","amz":"https://www.amazon.co.jp/gp/product/B074CFHRXR","ap":"renaissance-eve","kt":"9516","mal":"51329","mu":"86600"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"safe","tags":[{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}},{"id":"ee968100-4191-4968-93d3-f82d72be7e46","name":{"en":"Mystery"}}]}

:::{"id":"f1f13aae-afdf-4c53-aec4-caad7d499196","title":{"en":"Make It Only Love"},"altTitles":[{"ja":"メイクイットオンリーラブ"}],"lastChapter":"5.5","availableTranslatedLanguages":["en"],"description":{"en":"''Suddenly, a kiss with someone you admireーー!?"  

Nakamura Oto, a model who gets nervous even shooting promotional pictures is thinking about quitting his job. That's when Shion, a cameraman, tells him that an acquaintance of his is looking for a model. Unable to refuse, he decides to meet with the client… but when arrives at the meeting place, Ryou, a makeup artist he admires is thereーー?! Moreover, he's kissed by a half-asleep Ryou!?  

[Also included is an 11 page extra]"},"links":{"ap":"make-it-only-love","mu":"162382"},"originalLanguage":"ja","contentRating":"erotica","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}}]}

:::{"id":"f1fb6b10-346a-4527-a79b-70a84c9a09ee","title":{"en":"Hinagiku Virgin Lost Club e Youkoso"},"altTitles":[{"en":"Virgin Lost Club"}],"lastChapter":"9","description":{"en":"**Hinagiku Virgin Lost Club e Youkoso :** Hinagiku Kuroko, a shy girl with glasses, is in love with her co-class rep Otonashi Suguru but can't muster the courage to confess. But he did tell her once that her voice sounded like Moegi, the girl he likes… so why not use that to her advantage?  
  
**Nekoyashiki Yumemi Is Glaring at Me Again Today:** As a little girl, Yumemi used to love her uncle. Ten years later, as an almost adult teenager, she seems to inexplicably hate him… or does she?  
  
**The Queen Is an M Slave:** Tall and charismatic, Satsuki is the queen of the school and leads her "slave" Yuuichi by the nose. But she and her snarky pal Kanae also happen to have no experience whatsoever with men."},"links":{"al":"107074","mal":"117470"},"originalLanguage":"ja","contentRating":"pornographic","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"51d83883-4103-437c-b4b1-731cb73d786c","name":{"en":"Anthology"}},{"id":"5bd0e105-4481-44ca-b6e7-7544da56b1a3","name":{"en":"Incest"}},{"id":"aafb99c1-7f60-43fa-b75f-fc9502ce29c7","name":{"en":"Harem"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}},{"id":"fad12b5e-68ba-460e-b933-9ae8318f5b65","name":{"en":"Gyaru"}}]}

:::{"id":"f20282e5-c54c-441b-a5f2-a5ae5da3df81","title":{"en":"Abenobashi Magical Shopping Arcade"},"altTitles":[{"en":"Abenobashi Mahou Shoutengai"},{"en":"Абэнобаси: волшебный торговый квартал"},{"en":"アベノ橋魔法☆商店街"},{"en":"アベノ橋魔法商店街"},{"en":"아베노바시 마법 ☆ 상점가"}],"lastChapter":"12","availableTranslatedLanguages":["pl","en"],"description":{"en":"Sasshi's world is in disarray. His best gal pal, Arumi, is about to move away, and his Osaka neighborhood is being demolished in the name of urban renewal.  

However, this little neighborhood has some surprises under its concrete – it's actually a portal to parallel universes. And when this section of the city is leveled, the portal is cracked wide open. Sasshi and Arumi soon find themselves being hurtled from one strange world to the next! Making matters even more surreal, is the fact that these worlds seem to spoof and mock popular movies, video games, manga and anime!  

See [AnimeNewsNetwork](https://www.animenewsnetwork.com/encyclopedia/anime.php?id=820) for the anime."},"links":{"al":"30072","ap":"abenobashi-magical-shopping-arcade","kt":"184","mal":"72","mu":"3433"},"originalLanguage":"ja","publicationDemographic":"seinen","contentRating":"suggestive","tags":[{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"87cc87cd-a395-47af-b27a-93258283bbc6","name":{"en":"Adventure"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}}]}

:::{"id":"f207bd7e-2268-4188-92c6-aa53bdbdd622","title":{"en":"From friendship comes love"},"altTitles":[{"pt-br":"Da amizade vem o amor"}],"availableTranslatedLanguages":["pt-br"],"description":{"pt-br":"A história começa com Alex, nosso protagonista que retorna à sua cidade natal depois de 6 anos morando fora do país. Quando ele estava na Escola primária, havia um cara que costumava incomodá-lo, por causa de sua aparência delicada,  
Estar de volta para onde ele tem tantas lembranças ruins, não é algo que o alegre.  

From friendship comes love trata-se de uma webcomic postada originalmente no Tapastic e traduzida com a permissão da autora."},"links":{"engtl":"https://tapas.io/series/From-friendship-comes-love/info"},"originalLanguage":"en","contentRating":"safe","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

:::{"id":"f2096f50-eda1-47a6-9741-9fad97ca08d1","title":{"en":"Maju Battlefront"},"altTitles":[{"en":"The Demonbeast Battlefront"},{"en":"The Demonbeast War Front"},{"en":"The Demonic Beast Front"},{"ja":"魔獣戦線"},{"ja-ro":"Majuu Sensen"}],"lastChapter":"27","availableTranslatedLanguages":["en"],"relatedIdds":["e8ea2aea-0c5c-4452-8208-e3db1074b352"],"description":{"en":"A secret society of scientists seek to create advanced humanoid lifeforms through the hybrid of man and beast for their almighty Lord Yeshu and the new world that is nigh.   
When young Shin'ichi Kuruma is pulled into this inhuman pursuit and loses everything, his path of bloody vengence leads him into the depths of a conspiracy greater than he could ever imagine.   

From Ken Ishikawa, creator of Getter Robo and Kyomu Senki, is a tale of biblic myth, violent patricide and monstrous demonbeasts. This is Majuu Sensen: The Demonbeast Battlefront!"},"links":{"al":"95856","ap":"majuu-sensen","kt":"36468","mal":"92432","mu":"62013"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"suggestive","tags":[{"id":"256c8bd9-4904-4360-bf4f-508a76d67183","name":{"en":"Sci-Fi"}},{"id":"36fd93ea-e8b8-445e-b836-358f02b3d33d","name":{"en":"Monsters"}},{"id":"391b0423-d847-456f-aff0-8b0cfc03066b","name":{"en":"Action"}},{"id":"39730448-9a5f-48a2-85b0-a70db87b1233","name":{"en":"Demons"}},{"id":"3de8c75d-8ee3-48ff-98ee-e20a65c86451","name":{"en":"Animals"}},{"id":"87cc87cd-a395-47af-b27a-93258283bbc6","name":{"en":"Adventure"}},{"id":"ac72833b-c4e9-4878-b9db-6c8a4a99444a","name":{"en":"Military"}},{"id":"b29d6a3d-1569-4e7a-8caf-7557bc92cd5d","name":{"en":"Gore"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"cdad7e68-1419-41dd-bdce-27753074a640","name":{"en":"Horror"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}}]}

:::{"id":"f2221098-8a95-429c-92f5-c9228fffa505","title":{"en":"I Became the Dark Villain's White Moonlight"},"altTitles":[{"en":"Become The Blackening Villain's White Moonlight"},{"en":"Be the Moonlight"},{"zh":"成了黑化反派的白月光"}],"availableTranslatedLanguages":["en"],"description":{"en":"One minute Charlene, the PR queen, was distressed by the forced to be blackening prince in the book, and the next she traveled back in time to become his companion in his early childhood! In order to change Anthony's fate and her own, Charlene decides to use her intelligence and God's perspective to reverse the plot. Just why was the fragrant, soft little puppy as a child raised by herself to become a big wolf dog who wants to eat her whole? 'There had been really something wrong with my parenting system!'

---

**Note:** Chapter 1 & 2 were published together as joint release. The group decided to split the join release in the middle. This was inhithered for the chapters on MangaDex with admin approval for everyone's sanity."},"links":{"mu":"5ndvre3","raw":"https://ac.qq.com/Comic/comicInfo/id/650451"},"originalLanguage":"zh","publicationDemographic":"shoujo","contentRating":"safe","tags":[{"id":"3e2b8dae-350e-4ab8-a8ce-016e844b9f0d","name":{"en":"Long Strip"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"e197df38-d0e7-43b5-9b09-2842d0c326dd","name":{"en":"Web Comic"}},{"id":"f5ba408b-0e7a-484d-8d49-4e9125ac96de","name":{"en":"Full Color"}}]}

:::{"id":"f224c354-e627-48e7-a31e-dc388bf2bc9a","title":{"en":"America"},"altTitles":[{"ja":"アメリカ"}],"lastChapter":"5","availableTranslatedLanguages":["en"],"description":{"en":"By the end of the 1980s Nae wants to become a journalist more than anything and to leave Japan for the country where everything is possible, the United States. Until she is able to fulfill this dream, Nae shares her passion for American culture with her friends. Where will the road to America, so near yet so far, lead them, halfway between dream and disappointment?  

America describes the myth of the American Dream for young Japanese people who sometimes regard their traditions as obstacles between them and their dream.  

America is especially dear to Keiko Ichiguchi. In this book, she paints an inner portrait of young Japanese’s torments without falling into platitudes yet flirting with realism and tragedy."},"links":{"al":"49963","ap":"america","kt":"8469","mal":"19963","mu":"31755"},"originalLanguage":"ja","publicationDemographic":"shoujo","contentRating":"safe","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

:::{"id":"f2344fb4-fe0e-4809-9e4e-6a84b94dfe81","title":{"en":"Kowashiya Gen"},"altTitles":[{"ja-ro":"Kaitaiyagen"},{"en":"Distmantler Gen"},{"ja":"解体屋ゲン"},{"en":"Demolition Man Gen"}],"description":{"en":"Iwao Asakura, a.k.a. Gen, president of Asakura Corporation, a subcontractor demolition company, regains his passion as a world-class demolition engineer when Keiko Otsuki, an employee of major general contractor Sanyu Heavy Machinery Lease, brings him a demolition job. He accepted her invitation to join the "Sanyu Group" and established the company "Sanyu Blasting Co. Later, he added an old acquaintance, Roku Iwashita a.k.a. "Roku the Tugger", a wooden construction specialist, Hideo Tokita a.k.a. Hide, a crane engineer who was about to commit suicide due to debt, and Hikaru Nakahara, a truck driver and former TV personality, to his team. However, in order to become "Japan's No. 1 demolition company" that is not bound by the traditions of bid-rigging that persist in the construction industry, he leaves the Sanyu Group and reestablishes himself as Itsumo Blowup Co.

---
**It is one of the longest manga of all time, with 100 volumes as of May 2023.**"},"originalLanguage":"ja","contentRating":"safe","tags":[{"id":"07251805-a27e-4d59-b488-f0bfbec15168","name":{"en":"Thriller"}},{"id":"391b0423-d847-456f-aff0-8b0cfc03066b","name":{"en":"Action"}},{"id":"3b60b75c-a2d7-4860-ab56-05f391bb889c","name":{"en":"Psychological"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"5ca48985-9a9d-4bd8-be29-80dc0303db72","name":{"en":"Crime"}},{"id":"92d6d951-ca5e-429c-ac78-451071cbf064","name":{"en":"Office Workers"}},{"id":"b1e97889-25b4-4258-b28b-cd7f4d28ea9b","name":{"en":"Philosophical"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}},{"id":"ea2bc92d-1c26-4930-9b7c-d5c0dc1b6869","name":{"en":"Cooking"}},{"id":"ee968100-4191-4968-93d3-f82d72be7e46","name":{"en":"Mystery"}},{"id":"f8f62932-27da-4fe4-8ee1-6779a8c5edba","name":{"en":"Tragedy"}}]}

:::{"id":"f23fc0ed-4db9-42d5-9449-3f88e943ee43","title":{"en":"Honey Sweet Kitchen"},"altTitles":[{"ja":"ハニースウィート・キッチン"}],"lastChapter":"24","availableTranslatedLanguages":["en"],"description":{"en":"Just after entering university, Minato drops out to instead become the board chairman of her recently-deceased grandmother's cooking school.  

The head of confectionary, Nakamura, explains to Minato the school's current position. Heeding the advice of her childhood friend and current Chinese cuisine chef Ichika-kun, Minato hires the popular Japanese cuisine chef, the handsome Akiyama, and the Italian cuisine chef, Maeda, to become lecturers at the school. The kind and gentlemanly Akiyama; the unfriendly and strict Maeda; the splendid, despite his cute exterior, Ichika; the cool and mysterious Nakamura…  

Together with the four handsome chefs, Minato opens the cooking school. What will happen from here on…!?"},"links":{"al":"72373","amz":"https://www.amazon.co.jp/dp/B0756ZJKPC","ap":"honey-sweet-kitchen","kt":"22270","mal":"42373","mu":"71409"},"originalLanguage":"ja","publicationDemographic":"josei","contentRating":"safe","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"65761a2a-415e-47f3-bef2-a9dababba7a6","name":{"en":"Reverse Harem"}},{"id":"9ab53f92-3eed-4e9b-903a-917c86035ee3","name":{"en":"Crossdressing"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}},{"id":"ea2bc92d-1c26-4930-9b7c-d5c0dc1b6869","name":{"en":"Cooking"}}]}

