:::{"id":"f28ef7a6-7ecd-4a94-a604-e5286952ef60","title":{"en":"Pen Saki ni Syrup"},"altTitles":[{"en":"ペン先にシロップ"},{"en":"染上蜜糖的笔尖"},{"en":"蜜糖筆尖"}],"lastChapter":"24","availableTranslatedLanguages":["en"],"description":{"en":"Our hero is a high school boy who is also a mangaka. A handsome mangaka! A hard worker mangaka! And he attends a famous school for mangaka! He also always finishes his work before the deadline!  

Our heroine is a clumsy editor. She’s always doing her best but she’s still an idiot. She never finishes her work before the deadline and makes mistakes in the number of pages.  

So what will happen when the two of them meet…?"},"links":{"al":"69161","bw":"series/126169","mal":"39161","mu":"72130"},"originalLanguage":"ja","publicationDemographic":"shoujo","contentRating":"safe","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}}]}

