Always responsable in her activities, she uses some strange kind of way to calm herself only known by Yokura.

How the development will turn out when the two start to know each other?"},"links":{"mu":"5n9t5kq"},"originalLanguage":"ja","publicationDemographic":"shoujo","contentRating":"safe","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}}]}

:::{"id":"f2c17cf7-6d55-4719-82ba-cc9a8b32f0bb","title":{"en":"Nightmare Fortress - Majin no Jousai"},"altTitles":[{"ja-ro":"Nightmare Fortress ~Majin no Jousai~"},{"ja":"Nightmare Fortress ～魔神の城塞～"},{"zh":"魔神要塞"}],"availableTranslatedLanguages":["en"],"description":{"en":"Main storyline: There is a kingdom on a island somewhere in the four seas. All was well until one day it was attacked by an army of Demons via Sodomy - and of course the Prince of this kingdom was taken prisoner by the Devil King. With his last strength, the Prince casts a spell that takes this island to another realm, making it invisible - so that this "carnage" is maintained. Our main two characters are the Princes #1 bodyguard, and the bodyguard's protégé - so thus begins their quest to regain the kingdom, kill the demons, and save the Prince. But it won't be that easy, cause watch out the Demons are always ready for a thorough tumble!  

Volume 1 Extra - Kaneo-sama's New School Term  
Suehirouhji Kaneo, heir to a very noble family, transfers to a public high school with the ulterior motive of letting the "teachers have a taste of a humiliating kiss," which usually ends up in the teacher being dismissed. Will the new teacher fall for Kaneo-sama's charm/tricks?"},"links":{"amz":"https://www.amazon.co.jp/dp/4862630294/","mu":"6251"},"originalLanguage":"ja","contentRating":"safe","tags":[{"id":"391b0423-d847-456f-aff0-8b0cfc03066b","name":{"en":"Action"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}}]}

:::{"id":"f2c1b1f6-4878-4ce9-a206-bd930d9a4a1c","title":{"en":"Crossdressing Pandemic"},"altTitles":[{"ja-ro":"Josou Pandemikku"},{"ja":"女装パンデミック"},{"ja-ro":"Josou Pandemic"}],"lastChapter":"20","availableTranslatedLanguages":["en","ru"],"relatedIdds":["a3975286-ff80-4547-93da-ec42921dfe36"],"description":{"en":"Just as he was entering high school, Nanaki Koga experienced a certain accident and fell into a deep coma. After two years, he finally woke up.   
  
However, he found that the world had changed. While he was unconscious, a sudden craze hit Japan: crossdressing. Now the newest fad, approximately 90% of Japanese people dress up as the opposite gender.   
  
And so Nanaki re-enrolls in his all-boys school, in which every student wears a sailor fuku. And as luck has it, Nanaki has a surprisingly feminine face…"},"links":{"al":"124844","amz":"https://www.amazon.co.jp/%E5%A5%B3%E8%A3%85%E3%83%91%E3%83%B3%E3%83%87%E3%83%9F%E3%83%83%E3%82%AF1-%E3%83%B4%E3%82%A1%E3%83%AB%E3%82%AD%E3%83%AA%E3%83%BC%E3%82%B3%E3%83%9F%E3%83%83%E3%82%AF%E3%82%B9-%E5%93%81%E5%B7%9D%E3%83%9F%E3%82%AF%E3%82%BA/dp/4799213938","bw":"de4b9c86b3-f8c4-44c5-8ab8-2039e099d05a","mal":"134044","mu":"171710","raw":"https://comic.pixiv.net/amp/works/6672"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"suggestive","tags":[{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"5920b825-4181-4a17-beeb-9918b0ff7a30","name":{"en":"Boys' Love"}},{"id":"9ab53f92-3eed-4e9b-903a-917c86035ee3","name":{"en":"Crossdressing"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"e5301a23-ebd9-49dd-a0cb-2add944c7fe9","name":{"en":"Slice of Life"}}]}

:::{"id":"f2c7f3fc-b1bc-4d53-ac4c-95f4a3c1325b","title":{"en":"My Boyfriend​ is a​ Vampire"},"altTitles":[{"vi":"Bạn trai tôi là ma cà rồng"},{"en":"Vampire Boyfriend"},{"ko":"내 남친은 뱀파이어"}],"lastChapter":"51","availableTranslatedLanguages":["en"],"description":{"en":"Being beautiful is never easy, especially if you're an eighteen year old boy like Gene who is constantly mistaken for a girl because of his delicate good looks. Gene is, in fact, anything but delicate. He is the ringleader of a group of tough kids in an all boy's school, and he's quick to beat the living daylights out of anyone who even hints that he resembles a girl.  

If that wasn't hard enough for a regular teenage guy to cope with, his life is about to take a shocking turn for the worse. When Gene stumbles upon strange happenings in the forest, he gets sucked into a world of vampire intrigue and sinister romance that he never knew existed. And he learns that there are worse things than being turned into a vampire: being turned into a girl?!  

(Source: Mangaupdates)"},"links":{"al":"49984","ap":"my-boyfriend-is-a-vampire","kt":"8517","mal":"19984","mu":"52636"},"originalLanguage":"ko","publicationDemographic":"shoujo","contentRating":"safe","tags":[{"id":"2bd2e8d0-f146-434a-9b51-fc9ff2c5fe6a","name":{"en":"Genderswap"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"4d32cc48-9f00-4cca-9b5a-a839f0764984","name":{"en":"Comedy"}},{"id":"b9af3a63-f058-46de-a9a0-e0c13906197a","name":{"en":"Drama"}},{"id":"caaa44eb-cd40-4177-b930-79d3ef2afe87","name":{"en":"School Life"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"d7d1730f-6eb0-4ba6-9437-602cac38664c","name":{"en":"Vampires"}},{"id":"eabc5b4c-6aff-42f3-b657-3e90cbd00b75","name":{"en":"Supernatural"}}]}

