:::{"id":"f34f2b36-4a30-4ac9-bee1-630b3a37d7d9","title":{"en":"Fate/hollow ataraxia"},"altTitles":[{"ja":"フェイト／ホロウアタラクシア"}],"availableTranslatedLanguages":["en","fr","pt-br"],"relatedIdds":["155618a9-bd2b-41f9-abc3-a9f159447f27","1bd75596-892e-41c9-afd0-046d53fb5ced","21f5800a-13b8-44f1-8e50-3cff94f1397d","4cebfd41-d231-4e26-968a-6b5807d30488","69614e08-645c-4267-bb55-6b8b4485316c","8f8d1c7d-494f-4619-909e-b116ac2ccf9b","b443ff38-f6ef-4100-992e-dcdcfb842044","bb1563c3-d5dd-4589-8394-43efb725b8cf","bbd2292d-6c8a-4815-891f-b5022a5ba8c1","bfd26b44-3fb3-4b61-996a-7121d62082ce","d42ff2ef-b818-4712-8c2b-4c821c8599da","e6c69c7e-2812-4d16-9c4b-cdfbd48f0ae2","e9fb02c0-24d0-4b92-9ad3-f465f28da015","f0ac0f6e-18c1-433e-8920-b6ac5acfc60d","f29d4785-396a-494e-b48f-47d02f583276","fed545a0-d8f0-4606-8e21-5d161ec5ce0c"],"description":{"en":"The plot of Fate/hollow ataraxia is based half a year after the events of Fate/stay night. Like its preceding counterpart, the story is set in Fuyuki City. Bazett Fraga McRemitz, a member of the Mages' Association and a master in the 5th Holy Grail War, wakes on the fourth day of the 5th Holy Grail war with a new servant, Avenger, and no memory of what happened to her beforehand. She and Avenger set off to fight and win the Holy Grail War.  

Meanwhile, Shirō Emiya lives a peaceful life with all his friends from the 5th Holy Grail War. After one of her experiments changes time and space, Rin Tōsaka leaves for the Mages' Association in England to fix things. The Servants sense a new danger while dark creatures appear soon afterward. Shirō, as a precaution, sets off to ensure nobody is in danger and instead finds himself frequently meeting a mysterious girl, Caren Ortensia.  

Both Bazett and Shirō find themselves in time loop that lasts four days, beginning of the fourth day of the 5th Holy Grail War. Each time they die or survive four days, they always awake on the first day of the loop aware of what has happened to them since the first time loop began. Determined to end the loop, Bazett, Avenger, and Shirō fight to discover the truth behind what's causing the endless four days."},"links":{"al":"81987","ap":"fate-hollow-ataraxia","bw":"series/12112","ebj":"https://ebookjapan.yahoo.co.jp/books/215601/","kt":"10498","mal":"51987","mu":"98616","raw":"https://web-ace.jp/shonenace/contents/161/"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"safe","tags":[{"id":"391b0423-d847-456f-aff0-8b0cfc03066b","name":{"en":"Action"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}}]}

