:::{"id":"f3e472f1-ea9b-4a4a-8a7b-7732ea307d47","title":{"en":"Elf Tensei Kara no Cheat Kenkokuki"},"altTitles":[{"en":"From Elf Reincarnation to Cheat Kingdom Founding Chronicle"},{"ja":"エルフ転生からのチート建国記"},{"pt-br":"Da Reencarnação dos Elfos à Crônica da Fundação do Reino Cheat"}],"lastChapter":"15","availableTranslatedLanguages":["en","pt-br"],"description":{"en":"A genius magician, to fight against his fate to die a natural death from old age, grasped at the truth of magic to allow himself to reincarnate with a power he created himself. The cycle of reincarnation is repeated multiple times and in his 31st reincarnation, the magician became a boy named Syril who lives in a village of elves.   
  
However, that village is ruled by Humans, and the Elves are treated as cattle. After becoming 14 years old, Cyril, who regained his past knowledge and experience, stands up to help a girl, Lucie, who is his childhood friend. The story of the creation of an ideal country begins in that one village, a place where all races can coexist. Elves, Fox-girl, and various other Heroines.","pt-br":"Um mago gênio, para lutar contra seu destino de morrer de morte natural de velhice, agarrou a verdade da magia para se permitir reencarnar com um poder que ele mesmo criou. O ciclo de reencarnação é repetido várias vezes e em sua 31ª reencarnação, o mago se tornou um menino chamado Syril que vive em uma vila de elfos.

No entanto, essa vila é governada por humanos, e os elfos são tratados como gado. Depois de completar 14 anos, Cyril, que recuperou seus conhecimentos e experiências do passado, se levanta para ajudar uma garota, Lucie, que é sua amiga de infância. A história da criação de um país ideal começa naquela aldeia, um lugar onde todas as raças podem coexistir. Elfos, Raposas e várias outras Heroínas"},"links":{"al":"86400","amz":"https://www.amazon.co.jp/dp/B09D415WMB","ap":"elf-tensei-kara-no-cheat-kenkokuki","bw":"series/298596","cdj":"https://www.cdjapan.co.jp/product/NEOBK-2620537","ebj":"https://ebookjapan.yahoo.co.jp/books/639491","kt":"elf-tensei-kara-no-cheat-kenkokuki","mal":"159775","mu":"188605","nu":"elf-tensei-kara-no-cheat-kenkoku-ki","raw":"https://gaugau.futabanet.jp/list/work/5dd532027765612c32000000"},"originalLanguage":"ja","publicationDemographic":"shounen","contentRating":"suggestive","tags":[{"id":"0bc90acb-ccc1-44ca-a34a-b9f3a73259d0","name":{"en":"Reincarnation"}},{"id":"423e2eae-a7a2-4a8b-ac03-a8351462d71d","name":{"en":"Romance"}},{"id":"a1f53773-c69a-4ce5-8cab-fffcd90b1565","name":{"en":"Magic"}},{"id":"aafb99c1-7f60-43fa-b75f-fc9502ce29c7","name":{"en":"Harem"}},{"id":"ace04997-f6bd-436e-b261-779182193d3d","name":{"en":"Isekai"}},{"id":"cdc58593-87dd-415e-bbc0-2ec27bf404cc","name":{"en":"Fantasy"}},{"id":"dd1f77c5-dea9-4e2b-97ae-224af09caf99","name":{"en":"Monster Girls"}},{"id":"f4122d1c-3b44-44d0-9936-ff7502c39ad3","name":{"en":"Adaptation"}}]}

